export async function getIdByTripId(tripId: string): Promise<Id> {
    return makeId(tripId.replace(/_[01]$/, ""));
}

export async function getRouteSummary(id: Id): Promise<RouteSummary | null> {
    return ROUTES.get(id) ?? null;
}

export async function getRoutesSummary(): Promise<RouteSummary[]> {
    return ROUTES_ARR;
}

export async function getShapes(id: Id): Promise<[LatLng[] | null, LatLng[] | null]> {
    const shapes = SHAPES.get(id);
    const s0 = shapes?.[0]?.map(([lat, lng]) => ({ lat, lng })) ?? null;
    const s1 = shapes?.[1]?.map(([lat, lng]) => ({ lat, lng })) ?? null;
    return [s0, s1];
}



